from Type import Type

class Move:
    def __init__(self, name, type, power, energy, duration):
        self.name = name
        self.type = type
        # (PvE, PvP)
        self.power = power
        self.energy = energy
        self.duration = duration

    # main.charge_count()
    def charge_count(self, fast, mode=1, cycle=False):
        return -self.energy[mode] / fast.energy[mode] if cycle \
        else -(self.energy[mode] // fast.energy[mode])
    
    def charge_duration(self, fast, mode=1, cycle=False):
        return self.charge_count(fast, mode, cycle) * fast.duration[mode]

    def __str__(self):
        return f"{self.name} [{self.type.name}]"

    def __repr__(self):
        return f"Move(name='{self.name}', type={self.type}, power={self.power}, energy={self.energy}, duration={self.duration})"
    
